### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Reinforcement Learning Basics**
- **Markov Decision Process (MDP):** Fundamental framework for RL problems.
- **Policies:** Target policy (\(\pi\)) and behavior policy (\(\mu\)).
- **On-Policy vs. Off-Policy Methods:**
  - **On-Policy Methods:** SARSA, Expected SARSA.
  - **Off-Policy Methods:** Q-learning, Double Q-learning.

#### 2. **Temporal Difference (TD) Learning**
- **TD Error:** Difference between the estimated value and the target value.
  - **DQN TD Error:** \(\delta_1 = R_{t+1} + \gamma \cdot \max_{a} Q(S_{t+1}, a; \theta^-_t) - Q(S_t, A_t; \theta_t)\)
  - **Double DQN TD Error:** \(\delta_2 = R_{t+1} + \gamma \cdot Q(S_{t+1}, \arg \max_{a} Q(S_{t+1}, a; \theta_t); \theta^-_t) - Q(S_t, A_t; \theta_t)\)

#### 3. **Policy Gradient Methods**
- **Policy Gradient Theorem:** \(\nabla J(\theta) \propto \sum_s \mu(s) \sum_a q_\pi(s, a) \cdot \nabla \pi(a \mid s; \theta)\)
- **REINFORCE Algorithm:** Uses Monte Carlo methods to update policy parameters.

#### 4. **Function Approximation**
- **Linear Function Approximator:** Used to approximate the value function.
  - **Q Values:** \(Q(S_t, a_i; W_t) = \phi(S_t)^T W_t(a_i)\)
  - **TD Target (Q-learning):** \(R_{t+1} + \gamma \max_{a} Q(S_{t+1}, a; W_t)\)
  - **Semi-Gradient TD Update:** \(W_{t+1} = W_t + \alpha \delta \phi(S_t)\)

#### 5. **Eligibility Traces**
- **\(\lambda\)-Return:** \(G_t^\lambda = (1 - \lambda) \sum_{n=1}^\infty \lambda^{n-1} G_t^{(n)}\)
- **Characteristic Eligibility:** Used in policy gradient methods.

#### 6. **Algorithms and Pseudocodes**
- **SARSA:** On-policy TD control algorithm.
- **Q-Learning:** Off-policy TD control algorithm.

